  <ChakraProvider>
    {/* PROVIDER/STORE MAKES EVERYTHING ACCESABLE THROUGH THE APP SUPPOSEDDLY */}
    <Router>
      <App />
    </Router>
  </ChakraProvider>,
  document.getElementById("root")
);
